import './header.css'

function Header(props) {
    return (
        <div className='livre1'>
            div
            <h2>{props.title}</h2>
            <h2>{props.name}</h2>
            <h2>{props.date}</h2>
            <h2>{props.note}</h2>
            <img src={props.img}></img>
        </div>
    )
}

export default Header;
